INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (126401, 2002, 1, 0.0, "2023/06/30 12:00:00", "クローチェ", 1, 1.47, "2023/09/22 14:59:59", "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", 1, 10001, -470.0, 2);
