INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (126501, 2002, 2, 0.0, "2023/06/30 12:00:00", "ライラエル", 1, 0.0, "2023/09/22 14:59:59", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", 1, 10003, -470.0, 2);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (126501, 2002, 1, 0.0, "2023/06/30 12:00:00", "ライラエル", 2, 0.0, "2023/09/22 14:59:59", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 1, 10004, -470.0, 1);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (127702, 2002, 2, 0.0, "2023/09/15 15:00:00", "リンド", 1, 0.0, "2023/12/22 14:59:59", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 2, 10005, -470.0, 2);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (127702, 2002, 2, 0.0, "2023/09/15 15:00:00", "リンド", 2, 0.0, "2023/12/22 14:59:59", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 2, 10006, -470.0, 2);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (127802, 2002, 1, 0.0, "2023/09/15 15:00:00", "ヴルム", 1, 0.0, "2023/12/22 14:59:59", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 2, 10007, -470.0, 1);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (127802, 2002, 2, 0.0, "2023/09/15 15:00:00", "ヴルム", 2, 6.5, "2023/12/22 14:59:59", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 2, 10008, -470.0, 1);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (129602, 2002, 2, 0.0, "2023/12/15 15:00:00", "アネモネ", 1, 0.0, "2024/03/22 14:59:59", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 3, 10009, -470.0, 1);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (129602, 2002, 2, 0.0, "2023/12/15 15:00:00", "アネモネ", 2, 0.0, "2024/03/22 14:59:59", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 3, 10010, -470.0, 1);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (129701, 2002, 1, 0.0, "2023/12/15 15:00:00", "ネフィ=ネラ", 1, 0.0, "2024/03/22 14:59:59", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 3, 10011, -470.0, 1);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (129701, 2002, 2, 0.0, "2023/12/15 15:00:00", "ネフィ=ネラ", 2, 6.2, "2024/03/22 14:59:59", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 3, 10012, -470.0, 1);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (130301, 2002, 3, 0.0, "2024/03/15 15:00:00", "カノン", 1, 3.1, "2024/06/22 14:59:59", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 4, 10013, -470.0, 5);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (130301, 2002, 3, 0.0, "2024/03/15 15:00:00", "カノン", 2, 6.15, "2024/06/22 14:59:59", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 4, 10014, -470.0, 2);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (130401, 2002, 2, 0.0, "2024/03/15 15:00:00", "ナーナ", 1, 0.0, "2024/06/22 14:59:59", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 4, 10015, -470.0, 2);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (130401, 2002, 2, 0.0, "2024/03/15 15:00:00", "ナーナ", 2, 3.35, "2024/06/22 14:59:59", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 4, 10016, -470.0, 1);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (130502, 2002, 1, 0.0, "2024/06/15 15:00:00", "ホウオウ", 1, 0.0, "2024/09/22 14:59:59", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 5, 10017, -470.0, 1);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (130502, 2002, 2, 0.0, "2024/06/15 15:00:00", "ホウオウ", 2, 3.18, "2024/09/22 14:59:59", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 5, 10018, -470.0, 1);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (130503, 2002, 4, 0.0, "2024/06/15 15:00:00", "ホウオウ", 3, 0.0, "2024/09/22 14:59:59", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 5, 10019, -470.0, 4);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (123301, 2002, 1, 0.0, "2024/06/15 15:00:00", "ネア", 1, 4.9, "2024/09/22 14:59:59", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 5, 10020, -470.0, 2);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (123301, 2002, 1, 0.0, "2024/06/15 15:00:00", "ネア", 2, 4.8, "2024/09/22 14:59:59", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 5, 10021, -470.0, 2);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (133301, 2002, 3, 0.0, "2024/09/15 15:00:00", "カリザ", 1, 4.922, "2024/12/22 14:59:59", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 6, 10022, -470.0, 1);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (133301, 2002, 3, 0.0, "2024/09/15 15:00:00", "カリザ", 2, 9.638, "2024/12/22 14:59:59", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 6, 10023, -470.0, 5);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (133401, 2002, 1, 0.0, "2024/09/15 15:00:00", "ミーア", 1, 2.88, "2024/12/22 14:59:59", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 6, 10024, -470.0, 2);
INSERT INTO `v1_bda19a9d48fae87b731ca57f63f6ea51d3602f998680129596a2e0226d9374d9` VALUES (133401, 2002, 5, 0.0, "2024/09/15 15:00:00", "ミーア", 2, 4.818, "2024/12/22 14:59:59", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 6, 10025, -470.0, 1);
